  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Francis James Volkner (Frank) and STANDISH, Edith Frances
  JWILLIAMS, Bevan Sydney and WILLIAMS, Mary Margaret Wilder (Bettie)
  JWILLIAMS, Jon Standish and SATTRUP, Helen Rymer
  JWILLIAMS, Rachel Margaret and CHIBNALL, Brett Edward
  WILLIAMS, Rachel Margaret and CHIBNALL, Brett Edward (cont...)
  and the University of Waikato in administrative positions. She is currently working as Academic
  Planning Administrator for Waikato Management School and has just completed a Diploma in
  Communication.
  Brett studied at Waikato University completing a Bachelor of Science degree in 1981. From then
  until 1987 he worked as a social worker in Hamilton and Napier. In 1988 he completed a Diploma of
  Teaching at Hamilton Teachers' College and since then has been teaching at Hillcrest High School,
  Hamilton. He is currently a Form Dean and HOD Biology.
  01> CHIBNALL, Alice Margaret
  b 03.02.1991
  Alice b. at Hamilton, She attended Hillcrest High School Community Childcare Centre from the
  age of 14 months, until she began work at Silverdale Normal School. She enjoys art and has had
  a picture hung in the Waikato Society of Arts gallery.
  02> CHIBNALL, Grace Clare
  b 06.12.1993
  Grace b, at Hamilton. She has attended Hillcrest High School Community Childcare Centre since
  she was six months old
  02> WILLIAMS, Timothy Charles Standish
  b 22.03.1964
  Timothy b. at Hamilton. He attended Stratford High School and Raglan Area School. He completed
  School Certificate in 1980 and passed three sixth form exams in 1981. He has also done some
  Polytech papers, but now has some disagreements with "mainstream" education (eg: its methods; its
  scope with regards to data and knowledge in general). He has been doing a variety of seasonal work
  since 1991, and in 1996 bought shares in a 'new technology' company in Mount Maunganui.
  03> WILLIAMS, Martin Jon Evan
  b 29.11.1966
  Martin b. at Stratford. Address: 12 Tuarangi Road, Grey Lynn, Auckland; Email:
  martin.williams@rmmb.co.nz.
  Martin was educated at Stratford, Raglan, St Peter's School, Cambridge, and Massey University where
  he gained a BSc (Hons) in 1990. After two years travelling overseas, he returned to complete a
  law degree at Waikato University and graduated LLB(Hons) in 1995. He has since worked for Russell
  McVeagh Bartleet and Co in their environmental practice group, and is interested in continuing his
  career in the environmental law/consultancy field.
  04> WILLIAMS, Emily Clare
  b 11.10.1970
  Emily b. at Tauranga. She went to primary schools at Stratford and Raglan and then attended
  Taradale High School. She has completed TCB qualifying courses in Catering and professional Cookery
  at Central Institute of Technology and Wellington Polytechnic. After two years working in
  Queenstown, Emily was overseas for five years. She worked in Sydney, on the Queensland coast, and
  in Europe, latterly on ocean going yachts in the Baltic and Mediterranean. She also worked in the
  Caribbean and in the Indian Ocean at Seychelles. She is now studying in New Zealand.
